import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Bookings.css';

const Bookings = () => {
  const [bookedCars, setBookedCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    fetch('http://localhost:5000/api/cars')
      .then((res) => res.json())
      .then((data) => {
        const filtered = data.filter(car => car.status && car.status.toLowerCase() === 'booked');
        setBookedCars(filtered);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching cars:', err);
        setLoading(false);
      });
  }, []);

  if (loading) return <div className="bookings-loading">Loading...</div>;

  return (
    <div className="bookings-container">
      <h1 className="bookings-title">My Bookings</h1>
      {bookedCars.length === 0 ? (
        <div className="bookings-empty">No booked cars found.</div>
      ) : (
        <div className="bookings-grid">
          {bookedCars.map((car) => (
            <div className="bookings-card" key={car._id} onClick={() => navigate(`/car/${car._id}`)}>
              <img
                className="bookings-img"
                src={`http://localhost:5000${car.images && car.images.length > 0 ? car.images[0] : ''}`}
                alt={car.title}
              />
              <div className="bookings-card-content">
                <h2 className="bookings-car-title">{car.title}</h2>
                <div className="bookings-details">{car.brand} {car.model} ({car.year})</div>
                <div className="bookings-price">â‚¹{car.price.toLocaleString()}</div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Bookings;
